function Logout({ onLogin }) {
    function handleLogOut () {

        fetch("/logout", {
            method: "DELETE"
        })
        .then(r => {
            r.json()
            onLogin()
        })
        .then((data) => {
            window.location.href = '/'
        })
        };
    return (
        <div>
            <h1>Log out?</h1>
            <button onClick={handleLogOut}> Log Out </button>
        </div>
    )
}

export default Logout;
